INSERT INTO `clo_asiin` VALUES ('',''),('IT013_1','Understand basic data structures and algorithms'),('IT013_2','Analyze and evaluate data structures and algorithms.'),('IT013_3','Design algorithms and select data'),('IT045_1','Theoretical knowledge and understanding of current issues as well as practical experience of network design'),('IT045_2','Explain the network design process as well as scalability and security concepts'),('IT045_3','Construct network designs that provide high bandwidth and low delay required for real-time applications'),('IT045_4','Apply techniques to develop a baseline for measuring the performance of a new network design'),('IT045_5','Ability to evaluate the performance of wired and wireless computer networks using analytical and/or simulation tools'),('IT069_1','Explain and use concepts in object-oriented programming including classes, objects, abstraction, encapsulation, inheritance, and polymorphism.'),('IT069_2','Implement an object-oriented solution in JAVA programming language.'),('IT069_3','Analyze design principles and design patterns in object-oriented programing'),('IT076_1','Describe the implement of software development process.'),('IT076_2','Apply the principles and methods of software engineering in practice.'),('IT076_3','Practice teamwork skills in a software engineering project.'),('IT079_1','Produce an (Extended) Entity-Relationship (E-R) model from specifications.'),('IT079_2','Apply data normalization principles to transforming an ER model into a database schema.'),('IT079_3','Construct efficient SQL queries to retrieve and manipulate data as required.'),('IT090_1','Identify client needs based on a written or verbal specification'),('IT090_2','Know how analyze and design a system with object-oriented concepts and design patterns'),('IT090_3','Know how to work in team effectively'),('IT091_1','Analyze the components, architecture, and protocols in computer networks'),('IT091_2','Apply the theory in designing a small/medium computer networks'),('IT091_3','Show the ability to work in teams'),('IT099_1','use laboratory equipment in digital logic design.'),('IT099_2','design, construct, analyze, and troubleshoot simple combinational and sequential circuits.'),('IT099_3','measure and record the experimental data, analyze the results, and prepare a laboratory report for submission.'),('IT132_1','Understand basic contents of data warehousing and data mining.'),('IT132_2','Explain modern algorithms in the area of data mining and knowledge discovery.'),('IT132_3','Apply data mining techniques to some case studies using existing datasets.'),('IT132_4','Work in a team to build a data mining process.'),('IT134_1','The ability of designing and implementing some Internet of Thing systems.'),('IT134_2','The ability of applying some data mining techniques to analyze the data in some IoT applications.'),('IT137_1','Understand fundamental concepts of data analysis.'),('IT137_2','Apply data analysis techniques and tools to some practical cases in business/engineering.'),('IT137_3','Explain how to perform data analysis with descriptive statistics and inferential statistics.'),('IT142_1','Calculate probability distributions and fitting to experimental data including noise and systematics.'),('IT142_2','Apply Bayesian analysis in observational data.'),('IT142_3','Analyze dynamical multi-scale time series in experiments.'),('IT142_4','Aware of Monte-Carlo integration in observational data analysis.'),('IT148_1','Develop an understanding of experimental methods and major experimental designs in some case studies.'),('IT148_2','Learn how to plan, design and conduct experiments efficiently and effectively, and analyze the resulting data to obtain objective conclusions.'),('IT148_3','Implement Experimental Design solutions using different experimental design programming frameworks.'),('IT155_1','Formulate a practical problem as an optimization model and solve it using optimization solvers.'),('IT155_2','Understand the background theory of convex problem, duality, and iterative algorithms solving the problems.'),('IT155_3','Be able to develop computer programs that applied iterative algorithms such as gradient descent, stochastic gradient descent, proximal gradient descent, subgradient descent, … to solveoptimization problems in various applications.');
