INSERT INTO `course` VALUES ('CH011',1,'Chemistry for Engineer','Hoá học cho kĩ sư','3','0','This one‐semester course is designed for engineering students those who are pursuing a non‐ chemistry engineering degree such as information technology, bio‐technology, civil, biomedical, electronic and telecommunication engineering. The course will introduce the basic principles of chemistry and connect those principles to issues in engineering professions. The related lab‐work is not included in this course.'),('CH012',1,'Chemistry Laboratory','Thực hành hoá học','0','1','This course is designed for non-chemistry majors, as it is intended for students pursuing a degree in information technology, electronic and telecommunication. The course introduces the lab-work with emphasis on techniques relevant to engineering in chemistry.'),('EE050',1,'Introduction to Computer for Engineers','Giới thiệu máy tính cho kỹ sư','3','0','This course is an introduction to solving engineering problems through the use of the computer. It introduces general problem-solving techniques including the concepts of step-wise refinement applied to the development of algorithms. This course will cover elementary programming concepts using the MATLAB programming language and apply those concepts towards the solution of engineering problems.'),('EE093',1,'Digital Signal Processing Laboratory','Thực hành Xử lý tín hiệu số','0','1','This course is an introduction to the basic principles, methods, and applications of digital signal processing, emphasizing its algorithmic, computational, and programming aspects.'),('EN007',1,'Writing AE1','Tiếng anh chuyên ngành 1 (kỹ năng viết)','2','0','This course provides students with comprehensive instructions and practice in essay writing, including transforming ideas into differeant functions of writing such as process description, cause-effect, comparison-contrast, argumentative, and paraphrase-summary essays. Throughout the whole course, students are required to read university-level texts to develop the ability to read critically and to respond accurately, coherently and academically in writ- ing. Through providing them with crucial writing skills such as brainstorming, proofreading, documentation and editing, this course prepares the students for research paper writing in the next level of AE2 writing.'),('EN008',1,'Listening AE1','Tiếng anh chuyên ngành 1 (kỹ năng nghe)','2','0','The course is designed to prepare students for effective listening and note-taking skills, so that they can pursue the courses in their majors without considerable difficulty. The course is therefore lecture-based in that the teaching and learning procedure is built up on lectures on a variety of topics such as business, science, and humanities.'),('EN011',1,'Writing AE2','Tiếng anh chuyên ngành 2 (kỹ năng viết)','2','0','This course introduces basic concepts in research paper writing, especially the role of generalizations, definitions, classifications, and the structure of a research paper to students who attend English- medium college or university. It also provides them with methods of developing and presenting an argument, a comparison or a contrast. Students are required to work on the tasks selected to maximize their exposure to written communication and are expected to become competent writers in the particular genre: the research paper. As writing is part of an integrated skill of reading and writing where reading serves as input to trigger writing, this course is designed to familiarize non-native students with academic literature in their major study by having them read and critically respond to texts of a variety of topics ranging from natural sciences such as biology to social sciences and humanities like education, linguistics and psychology.'),('EN012',1,'Speaking AE2','Tiếng anh chuyên ngành 2(kỹ năng nói)','2','0','Giving presentations today becomes a vital skill for students to succeed not only in university but also at work in the future. However, this may be seen as a nerve-racking task, especially when presented in a foreign language. Speaking AE2 provides the students with the knowledge and skills needed to deliver effective presentations. To do this, the course covers many aspects of giving presentation: preparing and planning, using the appropriate language, applying effective visual aids, building up confidence, performing body language, dealing with questions and responding, etc.'),('EN072',1,'Reading & Writing IE1','Tiếng anh tăng cường 1 (kỹ năng đọc viết)','11','0',''),('EN073',1,'Listening & Speaking IE1','Tiếng anh tăng cường 1 (kỹ năng nghe nói)','11','0',''),('EN074',1,'Reading & Writing IE2','Tiếng anh tăng cường 2 (kỹ năng đọc viết)','11','0',''),('EN075',1,'Listening & Speaking IE2','Tiếng anh tăng cường 1 (kỹ năng nghe nói)','11','0',''),('ENTP00',1,'Intensive English 0','Tieeesng Anh Tăng Cường 0','17','0',''),('ENTP01',1,'Intensive English 1','Tieeesng Anh Tăng Cường 1','17','0',''),('ENTP02',1,'Intensive English 2','Tieeesng Anh Tăng Cường 2','13','0',''),('ENTP03',1,'Intensive English 3','Tieeesng Anh Tăng Cường 3','10','0',''),('IS021',1,'Deterministic models in Operations Research','Các mô hình tất định','3','1','This course is to introduce the fundamental methods used in deterministic operations research and to use of numerical analysis and linear algebra to solve industrial engineering problems. Topics to be covered include: problem formulations, simplex method in table form, duality theory, an introduction to the geometry of the simplex method, sensitivity analysis, and transportation and network flow problems.'),('IT007UN',1,'Skills for Communicating Information','Kỹ Năng Giao Tiếp Thông Tin','3','0',''),('IT011UN',1,'Functional Programming','Lập Trình Hàm','3','0',''),('IT011WE',1,'Skills for Communicating Information','Kỹ Năng Giao Tiếp Thông Tin','3','0',''),('IT013',1,'Algorithms and Data Structure','Cấu trúc dữ liệu và giải thuật','3','1','Provide an introduction to data structures and algorithms, including their design, analysis, and implementation.'),('IT017',1,'Operating Systems','Hệ điều hành','3','1','This course presents the theory, design, implementation, and analysis of computer operating systems. Through classroom lectures, labs, projects and exercises, students learn the fundamentals of concurrency and process management, inter-process communication and synchronization, memory management, job scheduling algorithms, input/output management, file systems, security in operating systems. Course labs use the C/C++ language and include the design and implementation of portions of an operating system.'),('IT024',1,'Computer Graphics','Đồ hoạ máy tính','3','1','This course provides students the fundamentals of computer graphics concepts, methodologies, and processes. It develop an understanding of the algorithms and fundamental techniques for generating and modifying pictures with a digital computer, including the handling of color, and the generation of visible-surface projections of three dimensional scenes, for applications in science, engineering, and the entertainment world.This course provides students the fundamentals of computer graphics concepts, methodologies, and processes. It develop an understanding of the algorithms and fundamental techniques for generating and modifying pictures with a digital computer, including the handling of color, and the generation of visible-surface projections of three dimensional scenes, for applications in science, engineering, and the entertainment world.prerequisitesIT116IU - C/C++ Programming,'),('IT044',1,'User Interface Design and Evaluation','Đánh Giá Thiết Kế Giao Diện Người Dùng','3','1',''),('IT045',1,'Network Design and Evaluation','Thiết kế và đánh giá mạng','3','1','The course focuses on utilizing the top-down network design principle: designing a logical network to accommodate your current and future business plans. It addresses the technical and management aspects related to data networks design and use. It also equips the students with the technical skills required to compare and contrast between the various techniques related to data networking and the ability to develop selection criteria to choose from the available alternatives.'),('IT056',1,'Software Project Management','Quản trị dự án phần mềm','3','1','This course provides students the fundamental software project management knowledge, with particular emphasis on software products, project management and contemporary issues in the delivery of software solutions to business. It considers plan-driven and agile methodologies, estimating techniques, change management, risk management, and the role of project management in business. And it identifies the managerial control and reporting aspects necessary from inception to implementation of a software development project.'),('IT058',1,'Thesis','Luận văn tốt nghiệp','0','10','Dissertations are industrial projects designed to ensure that students have mastered their subjects in the program. All projects are based on \"real projects\" provided by the industry to students to develop skills and apply knowledge gained from all courses throughout the program. Students will work independently to develop requirements, design, implement and provide solutions to business problems. Students can follow any appropriate process model, must self-manage the project, follow all appropriate project management techniques. The success of the project is largely determined by whether the student adequately solves the client\'s problem.Students will provide the final product with all artifacts that match the process model being used (e.g. project plan, technical requirements, system architecture, design documentation, test plan, source code and installed software products).'),('IT064',1,'Introduction to Computing','Nhập môn tin học','3','0','This course is to provide fundamentals and basic concepts of computer science and engineering, basics of Computing such as basic concepts, models, trends in industry. Introduction to majors and curricula, career path of all majors in computing, career orientation, job requirements and career opportunities in industry are also included in this course.'),('IT067',1,'Digital Logic Design','Thiết kế logic số','3','0','This course is to provide fundamentals of logic design, such as: number presentation and codes, Boolean algebra and basic tools for design with combinational and sequential digital logic.'),('IT068',1,'Principles of Electrical Engineering I','Nguyên lý mạch điện 1','3','0','This course covers the following topics: Circuit elements; Independent sources; Dependent sources; Circuit analysis in DC and AC steady state; Operational amplifiers; Power Computations; Two-port circuits; Balanced three-phase circuits. Special seminar(s)'),('IT069',1,'Object-Oriented Programming','Lập trình hướng đối tượng','3','1','Introduction to object-oriented programming and design. Topics include: abstraction and encapsulation, classes and objects, method overloading, inheritance, method overriding, polymorphism and dynamic binding, abstract classes and interfaces, generic and container classes, exception handling and thread.'),('IT070',1,'Principles of Electrical Engineering II','Nguyên lý mạch điện 2','3','0','This course covers the following topics: Transient analysis by classical methods and by Laplace transform analysis, step and impulse response. Passive and active filter circuit design. Introduction to Fourier series. Special seminars'),('IT074',1,'Electronics Devices','Linh kiện điện tử','3','0','Fundamentals of semiconductor devices and microelectronic circuits, characteristics of p-n, Zener diodes, and analog diode circuits. Principles of MOSFET and BJT operation, biasing, transistor analysis at midband frequencies.'),('IT075',1,'Signals and Systems','Tín hiệu và hệ thống','3','0','This course provides fundamentals of signals and systems and develops skills to analyze linear dynamic systems in both continuous and discrete-time domains. It covers the methods used to obtain the system response in both time domain (using convolution methods) and frequency domain (using Fourier, Laplace, and Z transform), and examine the stability of system. Special seminar(s)'),('IT076',1,'Software Engineering','Công nghệ phần mềm','3','1','This course provides students the fundamentals of software engineering concepts, methodologies, and processes. It covers the subjects on software process models, agile development methodologies, requirements engineering and analysis models, software design and implementation methods, test strategies, and software evolution. Students apply contemporary agile requirements analysis, planning, architecture, design, implementation and testing practices to software engineering project work in small teams.'),('IT079',1,'Principles of Database Management','Nguyên lý quản trị cơ sở dữ liệu','3','1','This subject introduces the students to basic database design and implementation concepts. Database design techniques, including relational design and E-R analysis, are presented. Database queries using SQL are covered in lectures and supported by practical exercises.'),('IT081',1,'Digital Electronics','Điện tử kỹ thuật số','3','0','This course provides the background in digital electronics and gives an understanding of the fundamentals of digital hardware based on the principles of digital electronics and the implementation of logic gates with MOSFETs and BJTs. The course develops an understanding and the analysis of different logic families including NMOS, CMOS, TTL and ECL, and it provides the fundamentals of digital memory circuits. PSpice simulations'),('IT082',1,'Internship','Thực tập công nghiệp','0','3','This course requires students to work in IT-related organizations or businesses from June to September. Each student has supervised by a faculty member at the School and an instructor at the organization. The student will join/run a technical project, and/or participate in soft skills courses. The internship lasts minimum 8 weeks and 3 sessions per week. Students have to report progress to instructors after 3 weeks of receiving the project. Depending on the project requirements of the organization or business, students may arrange for longer time. At the end of the internship, students will submit internship reports and assessment reports from the instructor at the organization or business to the School. Instructors read the reports and confirm the internship marks for the students. Students can also register this course in main semesters or take part in internships abroad for a period of 6 months. The registration and evaluation process are similar.'),('IT083',1,'Special Study of the Field','Thực tập tốt nghiệp','0','3','Students are advised to select a subject under the guidance of a faculty member. Project content might be a research topic or building a new application that underlies the graduation thesis. Research topics include fields of academic program that are academic or practical.'),('IT089',1,'Computer Architecture','Cấu trúc máy tính','3','1','This course provides students the principles of computer architecture and organization. It covers the subjects on assembly language and machine code, computer arithmetic and ALU design, computer performance, datapath and control, pipelining, memory hierarchy, I/O devices, multi-processor architectures, and mobile and multi-core processors.'),('IT090',1,'Object-oriented analysis and design','Phân tích và thiết kế hướng đối tượng','3','1','This course help students learn about system life cycle development and the knowledge and skills required to develop object-oriented system. The course tries to solve the following questions•	What are design approaches other than object-oriented design? What is object-oriented design? •	What is a good design? How do you differentiate between a good and a bad design? What are the important characteristics of a good design?'),('IT091',1,'Computer Networks','Mạng máy tính','3','1','This course covers the fundamental knowledge of computer networks such as OSI, TCP/IP models, network architectures, LAN, WAN, the typical network protocols. The students will also study to design, implement and monitor a small / medium scale network.'),('IT092',1,'Principles of Programming Languages','Nguyên lý ngôn ngữ lập trình','3','1','This course helps students: Learn important principles of programming languages; Learn basic components of programming languages; Learn programming language paradigms; Improve programming and software engineering skills'),('IT093',1,'Web Application Development','Phát triển ứng dụng Web','3','1','This course provides students the fundamentals of web design and web programming. It provide the concepts and models of HTML, Java Server Page, Java Bean, MVC model, Java utilities and development environments, extended Java frameworks as Ajax and Struts. To develop skills in understanding and evaluating web-based systems, as well as to develop skills in designing and developing web-based applications.'),('IT094',1,'Information System Management','Quản lý hệ thống thông tin','3','1','This course will aim to provide students with:The concepts of information systems and their applications to business processes.Use of computer-based information systems in functional areas of business. Understanding of computer and information technology, resources, management and end-user decision making, and system development.'),('IT096',1,'Net-centric Programming','Lập trình mạng','3','1','Advanced programming with a focus on developing software for networked systems using UNIX as a reference platform. Topics: Programming Tools, Software Design, Programming Techniques, Environment of a UNIX Process, Memory Allocation, Garbage Collection, Process Control, Process Relationships, Signals, Reliable Signals, Threads, I/O Multiplexing, Datagram and Stream Sockets, Multicasting, Device Driver and Kernel Programming, Secure Programming'),('IT097',1,'Introduction to Artificial Intelligence','Nhập môn trí tuệ nhân tạo','3','1','This course introduces students to the basic knowledge on Artificial intelligence. Artificial intelligence (AI) is a research field that studies how to realize the intelligent human behaviors on a computer. The ultimate goal of AI is to make a computer that can learn, plan, and solve problems autonomously. In this course, student will learn the foundational principles and practice implementing some of these applications including representation, problem solving, and learning methods of artificial intelligence. Accordingly, students should be able to develop intelligent systems by assembling solutions to concrete computational problems; understand the role of knowledge representation, problem solving, and learning in intelligent-system engineering; and appreciate the role of problem solving, vision, and language in understanding human intelligence from a computational perspective.'),('IT098',1,'Principles of Electrical Engineering I Laboratory','Thực hành Nguyên lý mạch điện 1','0','1','This course helps students to understand better the course Principles of Electrical Engineering I. Experimental exercises in use of laboratory instruments. Voltage, current, impedance, frequency, and waveform measurements. Rudiments of circuit modeling and design.'),('IT099',1,'Digital Logic Design Lab','Thực hành thiết kế logic số','0','1','This course provides students the fundamentals of digital logic design concepts, a sequence of laboratory experiments to present and illustrate theory of digital logic design involving Logic gates, Combinational logic circuit, MSI combinational logic circuit, Flip Flops and Counters, Counter ICs, and Shift register. Students apply contemporary agile requirements analysis, implementation and testing practices to digital logic design project work in small teams.'),('IT100',1,'Signals and Systems Laboratory','Thực hành Tín hiệu và hệ thống','0','1','This course covers the following topics: Experimental exercises via simulation using MATLAB to get understanding of frequency and time domain analysis of linear dynamic systems and corresponding signals. Finding the response of continuous- and discrete-time linear systems via simulation'),('IT101',1,'Electronics Devices Laboratory','Thực hành Linh kiện điện tử','0','1','Laboratory experiments in microelectronic circuits using semiconductor devices, including diodes, MOSFETs and BJTs. Employing a learn-by-doing approach, emphasizing the hands-on-experimental experiences and computer simulation.'),('IT102',1,'Principles of Electrical Engineering II Laboratory','Thực hành Nguyên lý mạch điện 2','0','1','This course covers the following topics: Experimental exercises in use of laboratory instruments; Filter design, construction, and simulation; measuring Fourier components of a periodic signal.'),('IT103',1,'Digital Signal Processing','Xử lý tín hiệu số','3','0','This course is an introduction to the basic principles, methods, and applications of digital signal processing, emphasizing its algorithmic, computational, and programming aspects. In particular, the students will learn the conversion from analog to digital, the concepts of discrete time linear systems, filtering, spectral analysis of discrete time signals and filter design.'),('IT105',1,'Digital System Design','Thiết kế hệ thống số','3','0','This course introduces methodology and techniques to design digital systems. The topics including the basic concepts, analysis, and system design with hardware description languages (HDL). The course provides an insight of the design of asynchronous sequential circuits and complex synchronous systems. Design process is introduced by concepts, documents, and simulation. .'),('IT106',1,'Digital System Design Lab','Thực hành Thiết kế hệ thống số','0','1','This lab helps students understand better about techniques to design digital systems. This lab includes software and hardware topics: Introduction to Maxplus II software, Counter, Introduction to VHDL in Maxplus II, Digital Clock.'),('IT110',1,'Concepts in VLSI Design','Khái niệm thiết kế VLSI','3','0','This course provides an introduction to digital VLSI chip design based on CMOS technology and including dynamic clocked logic, analog MOSFET timing analysis, and layout design rules. The course develops the use of computer-aided design software tools and cell library construction as well as an understanding of elementary circuit testing.'),('IT112',1,'Introduction to Distributed Computing','Giới thiệu tính toán phân tán','3','1','This course presents the theory, design, implementation, and analysis of distributed systems. Through classroom lectures, labs, projects and exercises, students learn the fundamentals of distributed systems, system models, remote procedure call, distributed objects, operating system support, security in distributed systems, distributed file systems, concurrency, transaction and synchronization, replication. Course labs use the C/C++ language and include the design and implementation of portions of a distributed system.'),('IT114',1,'Software Architecture','Kiến trúc phần mềm','3','1','Provides the student with a thorough understanding of varying methodologies and techniques in analysis, design and implementation of information system by using UML.'),('IT115',1,'Embedded Systems','Hệ thống nhúng','3','0','This course addresses the considerations in designing real-time embedded systems, both from a hardware and software perspective. The primary emphasis is on real-time processing for communications and signal processing systems. Programming projects in a high level language like C/C++ will be an essential component of the course, as well as hardware design with modern design tools.'),('IT116',1,'C Programming','Lập trình C/C++','3','1','This course concentrates on learning the basics of programming languages which is the foundations for further studies in IT. The course enables students to get familiar with C programming language. The course covers all basic C data structures, control flows, simple data structures as well as other advanced topics which include pointers, bit operators, file processing, dynamic data types.'),('IT117',1,'System and Network Security','Bảo mật hệ thống và mạng','3','1','This course introduces students to cryptography systems (symmetric and public key encryptions), basic information theory, authentication and authorization, database security, malicious software, denial of service attacks, intrusion detection and prevention systems, firewalls, buffer overflow attack and software security, Internet security protocols and standards, Internet authentication applications, and wireless security.'),('IT120',1,'Entrepreneurship','Khởi nghiệp','3','0','An introduction to the creative and innovative managerial practices of successful entrepreneurship. This course reviews the significant economic and social contributions entrepreneurs provide to society, the intense lifestyle commitment, and the skills necessary for entrepreneurial success. It explores how to identify and develop solutions to the most common leadership and personal challenges faced by entrepreneurs when starting new ventures or launching new products. It also promotes a deeper understanding of what is required to be a successful entrepreneur, highlights the skills and tools necessary to start a new business and explores alternatives to common pitfalls.This course applies entrepreneurial marketing approaches used by successful entrepreneurs. These include utilizing industry sector trends, identifying emerging customer niches, developing new products/services, using guerilla marketing strategies, and Internet and social marketing strategies. It emphasizes importance of managing cash flows, ratio analysis, pro forma development, and the basics of deal structure and harvesting a business venture. Students will identify and interpret sources of information from company financial reports, financial publications, industry benchmarks, the media, and web sites.An introduction to the process of researching, writing, and presenting a business plan. Students identify and screen ideas using a business feasibility study that describes the product features, market opportunity, customer profile, sales forecast, competitive advantage, and profit potential. Following a successful feasibility study, students may use business plan software as each develops their own complete business plan.'),('IT122',1,'Introduction to wireless networks','Nhập môn mạng không dây','3','1','This course covers the fundamental knowledge of wireless and mobile networks such as wireless signal propagation, the techniques in wireless transmission, modulation, coding,... Several wireless networks are covered such as wi-fi, blueooth, zigbee, LTE, ... The MAC protocols, routing protocols used in wireless networks are also studied.Introduce new networking technologies, covering network topologies, example deployment concepts, protocols, and management techniques. Explains the different elements and technologies that are used in enterprise network and how they relate to each other. Focus on fundamental concepts and principles. Provides a solid technical foundation to successfully navigate network management topics and apply those concepts to particular situations.'),('IT123',1,'Digital Electronic Laboratory','Thực hành Điện tử kỹ thuật số','0','1','This laboratory demonstrates transistor-level implementations of CMOS, TTL, and ECL logic gates, employing a learning-by-doing approach and emphasizing hands-on experimental experiences and computer simulations.'),('IT125',1,'System and Network Administration','Quản trị hệ thống mạng','3','1','Introduce new networking technologies, covering network topologies, example deployment concepts, protocols, and management techniques. Explains the different elements and technologies that are used in enterprise network and how they relate to each other. Focus on fundamental concepts and principles. Provides a solid technical foundation to successfully navigate network management topics and apply those concepts to particular situations.'),('IT126',1,'Concepts in VLSI Design Laboratory','Thực hành Khái niệm thiết kế VLSI','0','1','This laboratory provides an introduction to digital VLSI chip design based on the use of VLSI design tools to design a MIPS microprocessor chip. The laboratory employs a learning-by-doing approach, emphasizing hands-on practical design experiences and computer simulations.'),('IT127',1,'Embedded Systems Laboratory','Thực hành Hệ thống nhúng','0','1','This course integrates microprocessors into digital systems. The course includes hardware interfacing, bus protocols and peripheral systems, embedded and real-time operating systems, real-time constraints, networking, and memory system.'),('IT128',1,'Micro-processing Systems','Hệ thống vi xử lý','3','0','This course provides students the fundamentals of microprocessors and microcomputers; data flow; machine programming; assembly languages, architectures and instructions sets; stacks, subroutines, I/O, and interrupts; interfacing fundamentals; designing with microprocessors, and applications of micro-processing systems to some practical problems.'),('IT129',1,'Micro-processing Systems Lab','Thực hành Hệ thống vi xử lý','0','1','In this course the students will study and do experiments with AVR microcontroller development KIT. Student will be able to practice with following topics : assembly languages, architectures and instructions sets; stacks, subroutines, I/O, and interrupts; peripheral interfacing fundamentals; designing with microprocessors, and applications of micro-processing systems to some practical problems.'),('IT130',1,'Digital Image Processing','Xử lý ảnh số','3','1','This course helps students discuss on digital image processing fundamentals; review of Digital Signal Processing algorithms such as Discrete Fourier Transform; intensity transforms, frequency domain filtering; image restoration and reconstruction; color image processing; multiresolution processing; image compression; morphological image processing.'),('IT131',1,'Theoretical Models in Computing','Mô hình toán cho tin học','3','1','This course is oriented to those undergraduate students who require a working knowledge of numerical methods. Topics to be covered include solving nonlinear equations and linear systems, interpolation and least square method, numerical evaluation of derivatives, integral and solution of differential equation. The focus will be on understanding the solving techniques and the engineering meaning of diver problems, and not on rigorous profs. �'),('IT132',1,'Introduction to data mining','Nhập môn khai thác dữ liệu','3','1','This subject introduces the students to principles and algorithms of data mining, and requirements of a data mining process. Students will study data mining concepts and algorithms to solve problems of knowledge discovery. Students can develop skills of using recent data mining software for solving practical problems, and gain experience of doing independent study and research.'),('IT133',1,'Mobile Applicaton Development','Phát triển ứng dụng di động','3','1','This course is designed to introduce and familiarize students with programming in the mobile environment: Android platform will be used throughout the course. The course start with introductions to basic components, concepts, structures of Android applications then move on with common user interface elements, persistent storage, database for mobile etc. Introduction to most common tools and techniques for writing Android application is also included with hands on experience in form of lab exercise programming project.'),('IT134',1,'Internet of Things','Internet vạn vật','3','1','The course explains the architecture, components of Internet of Thing networks. The students will study the communication techniques between the components from short range to long range such as Bluetooth, Zigbee, Wi-fi, Lora, NB-IoT,… Moreover, the data storage, organization and analytics are also studied in this course.'),('IT135',1,'Introduction to Data Science','Nhập môn khoa học dữ liệu','3','0','This subject will provide a broad introduction to four key aspects of data science: data retrieval and manipulation, data visualization, statistical computation and machine learning, and presentation and communication. Students will use data from a variety of sources, be introduced to contemporary computing and database environments such as R/Python and SQL, and be exposed to case studies from outside the classroom. Through this unit students will become acquainted with the challenges of contemporary data science and gain an appreciation of the foundational skills necessary to turn data into information.'),('IT136',1,'Regression Analysis','Phân tích hồi quy','3','1','Regression analysis is one of the most powerful methods in statistics for determining the relationships between variables and using these relationships to forecast future observations. The foundation of regression analysis is very helpful for any kind of modelling exercises. Regression models are used to predict and forecast future outcomes. Its popularity in finance is very high; it is also very popular in other disciplines like life and biological sciences, management, engineering, etc.'),('IT137',1,'Data Analysis','Phân tích dữ liệu','3','1','This course introduces fundamentals of data analysis by learning data analysis process together with descriptive statistics and inferential statistics. Students will study how to collect data, process and turn them into useful information and knowledge which are important to decision making. From raw data to useful information then to knowledge, students will examine a number of datasets and case studies from different perspectives. Students are able to develop practical solutions to problems in business and engineering, and gain hands-on experience of using contemporary data analysis tools.'),('IT138',1,'Data Science and Visualization','Khoa học dữ liệu và trực quan hoá dữ liệu','3','1','The goal of this course is to introduce students to the key principles, methods, and techniques for effective visual analysis of data. The course begins with aims and key principles of data visualization. The course continues with different aspects of visualization including techniques and method for presenting different data types, and for discussing and analyzing visualizations. Thorough the course, students will be introduced to many visualization systems and visual tools via hand-on exercises.'),('IT139',1,'Scalable and Distributed Computing','Tính toán khả năng mở rộng và phân bố','3','1','This course presents the theory, design, implementation, and analysis of distributed systems. Through classroom lectures, labs, projects and exercises, students learn the fundamentals of distributed systems, system models, remote procedure call, distributed objects, operating system support, security in distributed systems, distributed file systems, concurrency, transaction and synchronization, replication. The course also covers advanced topics related to cloud and distributed data processing technologies: data partitioning, storage schemes, stream processing, and parallel algorithms. Course labs explore modern Internet and cloud computing services running on multiple geographically distributed data centers: Google, Yahoo, Facebook, iTunes, Amazon, eBay, Bing, etc.'),('IT140',1,'Fundamental Concepts of Data Security','Khái niệm cơ bản về bảo mật dữ liệu','3','1','This course introduces students to cryptographic principals and systems (symmetric and public key encryptions), and their applications in data security, secure communications, authentication and authorization. These core principles will be applied to the concepts of information risk management, and the analysis and handling of compromised systems. The ethics around computer crime, privacy, and intellectual property are covered in detail. Finally, the unit will cover the criteria and controls for information classification.'),('IT141',1,'Big Data Applications - Machine Learning at Scale','Ứng dụng dữ liệu lớn: Máy học ở qui mô lớn','3','1','The goal of this course is to equip students with the understanding, knowledge, and practical skills to develop big data solutions with the state-of-the-art big data management tools, particularly those in the Hadoop ecosystem, with a focus on programming models including MapReduce, Hive, Pig, and Apache Spark. .'),('IT142',1,'Analytics for Observational Data','Phân tích dữ liệu quan sát','3','1','This subject explains the principles and practice of modelling and analysing observational data, with an emphasis on practical application. The core concepts are probability modelling and prediction. Probability models for various kinds of data are introduced, including models for counts of events, categorical values and waiting times. The main focus is on analysing several or many variables, including techniques, such as, correlation, discrimination, principal components, model selection, and classification methods.'),('IT143',1,'Fundamentals of Big Data Technology','Nền tảng công nghệ dữ liệu lớn','3','1','Fundamentals of Big Data Technology provides baseline general knowledge of the technologies used in Big Data solutions. It covers the development of  solutions using the Hadoop ecosystem, including MapReduce, HDFS, Apache Pig and Hive programming frameworks. This course helps students build a foundation for working with Apache Big Data solutions.'),('IT144',1,'Business Process Analysis','Phân tích quy trình nghiệp vụ','3','1','Every organization thrives to implement effective business processes to increase employee and customer satisfaction, enhance business performance, reduce costs and boost productivity. All activities including altering critical processes, merging or splitting business units require a consistent framework to manage the changes. The course aims to provide fundamental knowledge of business process analysis, improvement and evaluation. Various approaches, techniques and software tools used to analyze and manage business process improvement are also introduced in the course.'),('IT145',1,'Decision support systems','Hệ thống hỗ trợ quyết định','3','1','A Decision Support System (DSS) is an interactive computer-based system or subsystem intended to help decision makers use communications technologies, data, documents, knowledge and/or models to identify and solve problems, complete decision process tasks, and make decisions. DSS simulate cognitive decision-making functions of humans based on artificial intelligence methodologies (including expert systems, data mining, machine learning, connectionism, logistical reasoning, etc.) in order to perform decision support functions. DSS is a general term for any computer application that enhances a person or group’s ability to make decisions. Also, DSS refers to an academic field of research that involves designing and studying DSS in their context of using.'),('IT146',1,'Theory of networks','Lý thuyết mạng máy tính','3','1','The course introduces the interconnectedness of modern life, answers the fundamental questions about how our social, economic, and technological worlds are connected. Students will study the modern network models, such as, game theory, the structure of the Internet, social contagion, the spread of social power and popularity, and information cascades.'),('IT147',1,'Mobile Cloud Computing','Điện toán đám mây di động','3','1','This course introduces the fundamentals of mobile cloud computing including mobile computing on smartphones, cloud computing on the data center, the combination of mobile, cloud computing and applications, and programming on smartphones using cloud services. Through classroom lectures, hands-on exercises, small and large assignments, students have knowledge of smartphone programming, cloud computing platforms, and support for cloud computing and applications. The exercises focus on the Java platform, Android and cloud computing and Internet services that run on a number of globally distributed data centers such as Google, Yahoo, Facebook, iTunes, Amazon, eBay, Bing, etc.'),('IT148',1,'Experimental Design','Thiết kế thực nghiệm','3','1','This subject provides students with skills of carrying out fully designed experiments, which can be used in a research paper, thesis, or dissertation proposal. Students will walk through controlled experiments and field experiments, single factor experiments and factorial designs, manipulation checks, etc., and be able to decide which of these experiments is best used in the creation of their own experiments, including making the stimuli and questionnaire.'),('IT149',1,'Fundamentals of Programming','Lập trình cơ bản','3','1','This course concentrates on learning the basics of programming languages which is the foundations for further studies in IT. The course enables students to get familiar with C programming language in UNIX environment. The course covers all basic C data structures, control flows, simple data structures as well as other advanced topics which include pointers, bit operators, file processing, dynamic data types.'),('IT150',1,'Blockchain','Blockchain','3','1','This subject introduces the students the foundation of blockchain technology and its applications. Students will study blockchain concepts and principles how it works. This course covers relevant topics blockchain space. The course starts with the basics of blockchain, cryptography, fundamental understanding of bitcoins. Then, the applications of blockchain technology is introduced in different areas of finance, healthcare, supply chain, etc. A complete picture of the ecosystem surrounding blockchain technology and development trends are also discussed.'),('IT151',1,'Statistical Method','Phương pháp thống kê','3','0','Provides students with a background in the statistical methods that assist in the analysis of data, including summarizing and describing data and techniques for inference. Topics include basic probability distributions (e.g. normal, binomial), expected value, estimation (maximum likelihood, confidence intervals), hypothesis testing, and multiple regression analysis.'),('IT152',1,'Data Mining for IOTs','Khai thác dữ liệu trong IOT','3','1','This subject introduces the students to principles and algorithms of data mining for internet of things applications. Students will study basic concepts, working principles and general architectures of different IOT frame works for practical applications such as smart healthcare, smart manufacturing, smart agriculture, etc. Students can develop practical data mining for solving practical problems, and gain experience of doing independent study and research.'),('IT153',1,'Discrete Mathematics','Toán rời rạc','3','0','This course provides students the based knowledge of discrete mathematics. To develop the ability to reason and think mathematically and logically; and to apply this ability to analyzing and solving discrete practical problems in computer science. This is an application-oriented course based upon the study of events that occur in small, or discrete in computer science, segments in business, industry, government and the digital areas. Students will be introduced to the mathematical tools of logic and set theory, counting, number theory, and graph theory. Practical applications will be introduced throughout the course'),('IT154',1,'Linear Algebra','Đại số tuyến tính','3','0',''),('IT155',1,'Optimization','Tối ưu hoá','3','0','This course is to introduce the fundamental methods used in deterministic operations research and to use of numerical analysis and linear algebra to solve industrial engineering problems. Topics to be covered include: problem formulations, simplex method in table form, duality theory, an introduction to the geometry of the simplex method, sensitivity analysis, transportation and network flow problems.'),('IT501',2,'Advanced Networking','Mạng máy tính nâng cao','3','1',''),('IT502',2,'Advanced Database','Cơ sở dữ liệu nâng cao','3','1',''),('IT503',2,'Programming Methodology','Phương pháp lập trình','2','0',''),('IT521',2,'Software Designs and Architectures','Thiết kế và kiến trúc phần mềm','3','1',''),('IT522',2,'Data Warehousing and Data Mining','Kho dữ liệu và Khai phá dữ liệu','3','1',''),('IT523',2,'User Interface','Giao diện Người dùng','3','1',''),('IT524',2,'Web Application Development','Phát triển ứng dụng Web','3','1',''),('IT525',2,'Information System Security','An ninh Hệ thống Thông tin','3','1',''),('IT531',2,'Network Management','Quản lý mạng','3','1',''),('IT532',2,'Distributed Computing','Tính toán phân bố','3','1',''),('IT533',2,'Wireless and Mobile Network','Mạng không dây','3','1',''),('IT534',2,'Network Application Development','Phát triển ứng dụng mạng','3','1',''),('IT535',2,'Advanced Operating System','Hệ điều hành nâng cao','3','1',''),('IT541',2,'E-Commerce','Thương mại điện tử','3','1',''),('IT542',2,'Information System Management','Quản trị Hệ thống Thông tin','3','1',''),('IT543',2,'IT Project Management','Quản trị dự án CNTT','3','1',''),('IT544',2,'Network Security','An toàn Mạng Máy tính','3','1',''),('IT545',2,'Algorithm Optimization','Tối ưu hóa giải thuật','3','1',''),('IT561_1',2,'Thesis (Research)','Luận văn tốt nghiệp','0','32',''),('IT561_2',2,'Thesis (Course Work)','Luận văn tốt nghiệp','0','12',''),('ITAI',1,'Prerequisite course of AI','','3','1',''),('ITCE1',1,'Elective ITCE1','Tự chọn ITCE1','3','1','Elective course for ITCE program'),('ITCE2',1,'Elective ITCE2','Tự chọn ITCE2','3','1','Elective course for ITCE program'),('ITCS1',1,'Elective CS1','Tự chọn CS1','3','1','Elective course for CS program'),(