01RG',1,'Calculus Math Physics Science','','4','0',''),('MA001UN',1,'Foundation Mathematics 1','','4','0',''),('MA003',1,'Calculus 2','Toán 2','4','0','To provide the students with the main notions and techniques of calculus of functions of several variables concerning limits, continuity, differentiation and integration; basic skills of computing the sum of series. Many applications explain how to use these notions and techniques in practical situations.'),('MA003UN',1,'Foundation Mathematics 2','','4','0',''),('MA023',1,'Calculus 3','Toán 3','4','0','To give the students:Knowledge of complex numbers and series, complex functions, and complex derivatives Knowledge of Laplace transforms, z-transforms, Fourier series and Fourier transforms, Fourier spectrum, frequency response, etc. Mathematical and computational skills needed in solving differential equations and in fields such as electric circuits, communications, signal processing and control, etc. To develop confidence and fluency in discussing mathematics in English.'),('MA024',1,'Differential Equation','Phương trình vi phân','3','1',''),('MA026',1,'Probability, Statistic & Random Process','Xác suất,thống kê và quá trình ngẫu nhiên','3','0','The course is aimed to provide the beginning students in engineering computer science with the simple concepts and techniques of probabilistic and statistics models and stochastic processes.'),('MITM_IM_1',2,'Elective 1 (Information Management Major)','Môn tự chọn 1 (chuyên ngành quản trị hệ thống thông tin)','3','1',''),('MITM_IM_2',2,'Elective 2 (Information Management Major)','Môn tự chọn 2 (chuyên ngành quản trị hệ thống thông tin)','3','1',''),('MITM_IM_3',2,'Elective 3 (Information Management Major)','Môn tự chọn 3 (chuyên ngành quản trị hệ thống thông tin)','3','1',''),('MITM_IM_4',2,'Elective 4 (Information Management Major)','Môn tự chọn 4 (chuyên ngành quản trị hệ thống thông tin)','3','1',''),('MITM_IM_5',2,'Elective 5 (Information Management Major)','Môn tự chọn 5