011',1,'Principle of Marxism','Chủ nghĩa Mác Lênin','5','0',''),('PE012',1,'Ho Chi Minh\'s thought','Tư tưởng Hồ Chí Min','2','0',''),('PE013',1,'Revolutionary Lines of Vietnamese Communist Party','Đường lối cách mạng Đảng Cộng Sản Việt Nam','3','0',''),('PE014',1,'Environmental Science','Khoa học môi trường','3','0','This course provides the basic knowledge of environmental science that includes general issues, ecology, and the impact of human activities to natural resources and environment and sustainable development. The course topics will include all general issues; ecology: the basics of environmental science; population growth and utilization of natural resources and the environment; natural resources and current exploitation; pollution and its impacts, environmental economic and sustainable development. It also aims at increasing general awareness of the students about possible impacts of human activities on the environment and natural resources in order to justify relevant economic practices.'),('PE015',1,' Philosophy Marx - Lenin','Triết Học Mac Lenin','3','0',''),('PE016',1,'Marxist – Leninist Political Economy','Kinh tế chính trị Mác-Lênin','2','0',''),('PE017',1,'Scientific Socialism','Chủ nghĩa xã hội khoa học','2','0',''),('PE018',1,'History of Vietnamese Communist Party','Lịch sử Đảng Cộng Sản Việt Nam','2','0',''),('PE019',1,'Ho Chi Minh\'s Thoughts','Tư tưởng Hồ Chí Minh','2','0',''),('PE020',1,'Engineering Ethics and Professional Skills','Đạo đức và kỹ năng nghề nghiệp','3','0','This course is designed to introduce engineering students to the concepts, theory and practice of engineering ethics. It will allow students to explore the relationship between ethics and engineering and apply classical moral theory and decision making to engineering issues encountered in academic and professional careers. Our society places a great deal of responsibility on its professionals and requires that they conduct themselves in a manner fitting to the place of prominence accorded to them by the community. Studying and understanding professional ethics is as much a part of your development as an engineer as is the study of higher order mathematics You must be able to broaden your mind and be open to society\'s ever changing fact that you may not always agree; therefore, we will be working in teams on majority of the character. It is important that you learn to share ideas and concepts regardless of the assignments in this course.'),('PE501',2,'Research Methodology','Phương pháp luận NCKH','2','0',''),('PE502',2,'Professional Ethics','Đạo đức nghề nghiệp','2','0',''),('PE505',2,'Philosophy','Triết','3','0',''),('PH012',1,'Physics 4 (Wave and Modern Physics)','Vật lý 4','2','0','This course provides students with basic knowledge of Wave and Modern Physics'),('PH013',1,'Physics 1 (general mechanics','Vật lý 1','2','0','An introduction to mechanics including: concepts and principles of kinetics'),('PH014',1,'Physics 2 (Fluid Mechanics and Thermal Physics)','Vật lý 2','2','0','This course provides students with basic knowledge of Wave and Modern Physics'),('PH015',1,'Physics 3 (Electricity and Magnetism)','Vật lý 3','3','0','This course provides students with basic knowledge of electricity and magnetism.'),('PH015UN',1,'Electricity & Magnetism','','3','0',''),('PH016',1,'Physics 3 Laboratory','Thực hành Vật lý 3','0','1','This course provides students with basic knowledge of electricity and magnetism in laboratory consists of: Ohm\'s law, LRC circuit, LR curcuit, magnetic fields of coils'),('PH016UN',1,'Electricity & Magnetism Laboratory','','0','1',''),('PT001',1,'Physical Training 1','Giáo dục thể chất 1','3','0',''),('PT002',1,'Physical Training 2','Giáo dục thể chất 2','0','3',''),('UFCF7H-15-3',1,'Mobile Applications','Ứng Dụng Mobile','15','0',''),('UFCFB5-15-3',1,'Ethical and Professional Issues in computing and digital media','Đạo Đức Nghề Nghiệp trong tin học và truyền thông số','15','0',''),('UFCFEL-15-3',1,'Security Data Analytics and Visualization','Trực Quan Hóa và Phân Tích Dữ Liệu An Toàn Thông Tin','15','0',''),('UFCFFC-30-3',1,'Information Technology Project','Dự Án Công Nghệ Thông Tin','30','0',''),('UFCFJP-15-3',1,'Big Data Analytics','Phân Tích Dữ Liệu Lớn','15','0',''),('UFCFRB-15-3',1,'Security Management in Practice','Quản Lý An Toàn Thông Tin Trong Thực Tế','15','0',''),('UFCFX3-15-3',1,'Advanced Topics in Web Development','Chủ Đề Nâng Cao Phát Triển Web','15','0','');
